ALTER SEQUENCE schema_id_seq RESTART WITH 4;
ALTER SEQUENCE hook_id_seq RESTART WITH 3;
ALTER SEQUENCE run_id_seq RESTART WITH 4;
ALTER SEQUENCE hibernate_sequence RESTART WITH 100;
